import React from "react";

let Users = (props) => {
  return (
    <div>
      {props.usersData.map((user) => {
        <div key={user.id}>
          <span>
            <div>
              <img />
            </div>
            <div>
              <button>follow</button>
            </div>
          </span>
          <span>
            <span></span>
            <span></span>
          </span>
        </div>;
      })}
    </div>
  );
};

export default Users;
